import java.util.HashMap;
import java.util.Map;

//leetcode submit region begin(Prohibit modification and deletion)
class Solution_76 {

    /*
     * Êö¥ÂäõÊ≥ïÊúÄ‰ºòÂèØ‰ºòÂåñÂà∞N2,Âú®NÈïøÂ∫¶ËæÉÈïøÊó∂Êó∂Èó¥‰æùÁÑ∂ËæÉÈïø
     * Âõ†‰∏∫ÊòØÊâæÊúÄÁü≠ÈïøÂ∫¶ÔºåÊö¥ÂäõÊ≥ïÂ§ö‰∫ÜÊó†ÊïàÁöÑËÆ°ÁÆóÂíåÊØîËæÉ
     * */
    public String minWindow(String s, String t) {
        int sLen = s.length();
        int tLen = t.length();
        if (sLen < tLen) {
            return "";
        }
        char[] sArr = s.toCharArray();
        char[] tArr = t.toCharArray();
        //        Map<Character, Integer> tFreqMap = new HashMap<>();
        //        Map<Character, Integer> sFreqMap = new HashMap<>();
        int[] tFreq = new int[128];
        int[] sFreq = new int[128];
        for (char c : tArr) {
            tFreq[c]++;
        }
        // Ê±âÊòéË∑ùÁ¶ªÔºå‰∏étLenÈïøÂ∫¶Áõ∏Á≠âÂàôÂåÖÂê´t‰∏≠ÊâÄÊúâÂ≠óÁ¨¶
        int distance = 0;
        // ÊªëÂä®Á™óÂè£Â∑¶Âè≥ÊåáÈíàÔºåÂ∑¶Èó≠Âè≥ÂºÄ
        int left = 0;
        // Ëµ∑Âßã0ÔºåÂÖàÂä†‰∏Ä
        int right = 0;
        // ‰øùÂ≠òÊúÄÁªàÊúÄÁü≠Âå∫Èó¥Ëµ∑ÁÇπ
        int begin = 0;
        // ÊúÄÁü≠ÈïøÂ∫¶
        int minLen = sLen + 1;
        // ÂÖàÂè≥ÁßªÂà∞ÊåáÂÆöÁöÑdistanceÂÜçÂºÄÂßãÂ∑¶ÁßªÔºåÂ§ñÂ±ÇwhileÂæ™ÁéØÂç≥ÊéßÂà∂distanceÁõ∏ÂÖ≥ÁöÑÂè≥Áßª
        while (right < sLen) {
            //            System.out.println("right" + right + " " + left);
            char c = sArr[right];
            if (tFreq[c] == 0) {
                right++;
                continue;
            }
            if (sFreq[c] < tFreq[c]){
                distance++;
            }
            // Â∑¶‰æßÁßªÂä®ÂÆåËØ•Âè≥‰æßÁßªÂä®‰∫ÜÔºåÊàñËÄÖÊú™ËææÂà∞Âè≥‰æßÊúÄÈïøÈïøÂ∫¶ÔºåËøòË¶ÅÁªßÁª≠ÁßªÂä®
            sFreq[c]++;
            right++;
            // Â∞è‰∫étLenÁöÑÈïøÂ∫¶Êó†È°ªÈÅçÂéÜ,left < right‰∏çË¶ÅÂ∞ë
            while (distance == tLen) {
                //                System.out.print(left + "-" + right + "-" + +distance + " ");
                if (right - left < minLen) {
                    // rightÂ∑≤ÁªèÂä†‰∏ÄÔºåÊ≠§Â§ÑÊòØ‰∏ã‰∏Ä‰∏™Á¥¢Âºï
                    minLen = right - left;
                    begin = left;
                }
                c = sArr[left];
                if (tFreq[c] == 0) {
                    left++;
                    continue;
                }
                // Âú®È¢ëÊ¨°ÂèòÂ∞ëÁöÑ‰πãÂâç‰∏∫Â§ß‰∫éÔºåÁ≠â‰∫éÊó∂‰∏∫ÊúÄÁü≠ÈïøÂ∫¶
                if (sFreq[c] == tFreq[c]) {
                    distance--;
                }
                // Â∑¶‰æßÁßªÂä®ÂÆåËØ•Âè≥‰æßÁßªÂä®‰∫ÜÔºåÊàñËÄÖÊú™ËææÂà∞Â∑¶‰æßÊúÄÁü≠ÈïøÂ∫¶ÔºåËøòË¶ÅÁªßÁª≠ÁßªÂä®
                sFreq[c]--;
                left++;
            }
        } if (minLen == sLen + 1) {
            return "";
        }
        return s.substring(begin, begin + minLen);
    }

    public static void main(String[] args) {
        Map<Character, Integer> map = new HashMap<>();
        map.put('a', 1);
        map.put('a', 2);
        System.out.println(map);
        System.out.println(map.getOrDefault('a', 0));
        map.put('a', map.getOrDefault('a', 0) + 1);
        System.out.println(map);
        System.out.println(new Solution_76().minWindow(
                "",
                ""));
    }

}
